import React, { Component } from 'react';
import './cnts/cnt.css';
import '../App.css';
import './pages.css';


class LandingPage extends Component {
    id = 2
    state = {
        information: [
        {
            id: 0,
            name: '김민준',
            phone: '010-0000-0000'
        },
        {
            id: 1,
            name: '홍길동',
            phone: '010-0000-0001'
        }
        ]
    }
    handleCreate = (data) => {
        const { information } = this.state;
        this.setState({
        information: information.concat({ id: this.id++, ...data })
        })
    }
    render() {
    return(
        <div className="cnt_wrap">
            <div className="cnt">
                <div className="cnt_tit">랜딩 / 상세페이지 디자인</div>
                <div className="tit_line"></div>
                <div className="cnt_sub_tit">Page_Design / 작업물 중 일부를 첨부하였습니다.</div>
                <div className="cnt_sec cnt_sec2 land_sec">
                    <div className="cnt_inner_wrap2">    
                        {menuList} <br/><br/><br/><br/><br/><br/> 
                    </div>      
                </div>
            </div>
        </div>
    )
    
}
}
export default LandingPage;
